import React from "react";


class Products extends React.Component {

    render() { 
        return (
            <div className="row">
                <div className="col-2">
                <span>{this.props.product.name}</span>
            </div>
                <div className="col">
                     <span>{this.props.product.count}  </span>
                     <button className="btn btn-primary m-2 " onClick={()=> this.props.onIncrement(this.props.product)}>+</button>
                     <button className="btn btn-primary m-2 " onClick={()=> this.props.onDis(this.props.product)}>-</button>
                <button className="btn btn-primary m-2 " onClick={()=>this.props.onDelete(this.props.product)}>Delete</button>
                </div>
            </div>

        );
    }
}

export default Products;
